import React from "react";
import { Link } from "react-router-dom";
import { connect, useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import "../reset.css";
import "../App.scss";
import { EditorAction } from "..";

function MainFooter(props) {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  return (
    <footer className="footer_bar">
      {props.addToggle === false ? (
        <button onClick={() => dispatch(EditorAction())}>
          <img src="/img/adds.svg" alt="add"></img>
        </button>
      ) : null}
      <div
        className="home f_con"
        onClick={() => {
          navigate("/");
        }}
      >
        <img src="/img/home.svg" alt="home"></img>
        <p>홈</p>
      </div>
      <div
        className="calendar f_con"
        onClick={() => {
          navigate("/calendar");
        }}
      >
        <img src="/img/calendar.svg" alt="calendar"></img>
        <p>캘린더</p>
      </div>
    </footer>
  );
}

function redux공장(state) {
  return {
    state: state.reducer,
  };
}

export default connect(redux공장)(MainFooter);
